import Vue from 'vue'
import App from './App.vue'

import router from "./router"
import store from "./store"

import Vant from 'vant';
import 'vant/lib/index.less';

import "./styles/index.less"
import 'amfe-flexible'

Vue.use(Vant);

Vue.config.productionTip = false

new Vue({
  render: h => h(App),
  router,
  store,
}).$mount('#app')
